import React from 'react';
import { Route, Switch } from 'react-router-dom';
import { Home } from "./components";

const App = () => {
  return (
    <div>
        <nav>
            <Link to="/">Home</Link>
        </nav>
        <Switch>
            <Route exact path="/">
                <Home />
            </Route>
        </Switch>
    </div>
  )
}

export default App;
